import Header from "./components/Header"
import Sider from "./components/Sider"
import Etusivu from "./components/Etusivu"
import Footer from "./components/Footer"
import Hyvinvointi from "./components/HyvinvointiPalvelut"

function App(){
    const [page,setPage] = useState(Etusivu)
    function onClickEtusivu(){
       setPage(Etusivu)
        console.log("hello world")
    }
    function onClickHyvinvointi(){
        setPage(Hyvinvointi)
         console.log("hello world")
     }

  //  <Etusivu></Etusivu>
  //<Hyvinvointi></Hyvinvointi>
    return(
        <div className="container">
            <Header site1={onClickEtusivu} site2={onClickHyvinvointi}></Header>
            <div className="main">
                {page}
            </div>
            <Sider></Sider>
            <Footer></Footer>
        </div>
    )
}

export default App
